import cl from "./Input.module.css";
import Icon from "./icon.svg";

export const Input = ({
  children = "Click me",
  type,
  size,
  color,
  variant,
  disabled,
  startIcon,
  endIcon,
  placeholder,
  ...props
}) => {
  return (
    <input
      className={[cl.input, cl[size], cl[variant], cl[type],cl[color]].join(" ")}
      disabled={disabled}
      placeholder={placeholder}
      {...props}>
      {startIcon ? <img src={Icon} alt="" className={cl.svgStart}></img> : ""}
      {endIcon ? <img src={Icon} alt="" className={cl.svgEnd}></img> : ""}
    </input>
  );
};
